<p style="text-align:center"><span style="font-size:14px">&nbsp;<strong> <em>Styczen</em></strong><br />
&nbsp;Nowy Rok zawital wreszcie<br />
&nbsp;stary sobie poszedl.<br />
&nbsp;Co tam rosnie w mrozach stycznia?<br />
&nbsp;Dzien rosnie po trosze!<br />
&nbsp;Wr&oacute;belkowi serce rosnie,<br />
&nbsp;ze wiosny doczeka,<br />
&nbsp;chociaz jeszcze droga do niej<br />
&nbsp;mrozna i daleka.<br />
&nbsp;Rosna w styczniu zaspy sniegu,<br />
&nbsp;ze w&oacute;z w nich ugrzeznie<br />
&nbsp;a na szybach rosna srebrne<br />
&nbsp;liscie i galezie.<br />
&nbsp;Wiec na inne pory roku,<br />
&nbsp;nie patrzy zazdrosnie<br />
&nbsp;mrozny styczen: bo w nim takze<br />
&nbsp;mn&oacute;stwo rzeczy rosnie! </span></p>

