za pomoc w <a href="https://www.youtube.com/watch?v=DpsnQ0xaQkw">okladaniu ksiazek</a>.</strong></span></p>

<p style="text-align:center"><span style="color:#0000CD"><span style="font-size:16px"><strong>Helenie </strong></span></span><span style="font-size:14px"><strong>i </strong></span><span style="color:#0000CD"><span style="font-size:16px"><strong>Antoninie </strong></span></span><span style="font-size:14px"><strong>z klasy 7a - za dbanie o <a href="http://www.ucarecdn.com/75fcfacb-84e2-4904-9376-db85d827adea/-/preview/">porzadek na p&oacute;lkach</a></strong></span><span style="font-size:14px"><strong>.</strong></span></p>

