<p style="margin-left:40px"><img alt="" src="http://www.ucarecdn.com/b852c2f1-7575-4303-bc0b-da21aecdc5c6/-/preview/" style="float:right; height:333px; margin:15px; width:250px" /></p>

<p><span style="font-size:14px">Dzisiaj chce Wam zaproponowac nowe czasopismo, kt&oacute;re dzieki uprzejmosci kilku os&oacute;b moglo&nbsp;zagoscic na naszych p&oacute;lkac</span>h:<br />
<span style="color:#0000CD"><span style="font-size:14px"><strong>miesiecznik turystyczno-historyczny &quot;Nasza Gdynia&quot;</strong></span></span>.</p>

<p><br />
<span style="font-size:14px">&quot;Zadaniem naszej redakcji&nbsp;- pisze w slowie wstepnym red. nacz. Jaroslaw Barbarski (nr 1, s. 3) - jest poszukiwanie takich temat&oacute;w, kt&oacute;re pomoga mieszkancom i odwiedzajacym gosciom poznac blizej najwieksze atrakcje, zaciszne &#39;kaciki&#39;, historie, ludzi oraz wydarzenia zwiazane z Gdynia&quot;.<br />
<br />
Za zachete do poznawania przeszlosci naszego miasta niech posluzy maksyma Zygmunta&nbsp;Glogera z <em>Encyklopedii&nbsp;staropolskiej</em>:&nbsp;</span><br />
<span style="color:#0000CD"><span style="font-size:16px"><strong>&quot;Obce rzeczy wiedziec dobrze jest - swoje, obowiazek&quot;</strong></span></span><span style="font-size:14px">.&nbsp;</span></p>

<p><br />
