<p><img alt="Pobierz obrazki" src="http://pictureshare.pl/screenshooter-imageconverter5bbe0d91a73171.png?sum=73cb7ccfde9e5ad545ec58e086347cefe037c174" style="-webkit-text-stroke-width:0px; background-color:transparent; border-image:none; border:0px rgb(129, 129, 129); color:rgb(129, 129, 129); display:block; font-size-adjust:none; font-stretch:normal; font:400 13px/13.33px arial,helvetica,sans-serif; height:75px; letter-spacing:normal; orphans:2; text-align:center; text-decoration:none; text-indent:0px; text-transform:none; white-space:normal; width:190px; word-spacing:0px" /><span style="font-size:12px"><span style="font-family:verdana,geneva,sans-serif">Dzisiaj otrzymalismy potwierdzenie, ze nasza Szkola po raz kolejny zakwalifikowala sie do projektu &quot;Upoluj swoja ksiazke&quot;, realizowanego w ramach og&oacute;lnopolskiej akcji Czytaj PL. <span style="color:rgb(14, 19, 23)">Jak pisza na swojej stronie Organizatorzy,&nbsp; <a href="http://mail.mailnews.pl/p/mydtz7o6cr/62ekfvwj1z/">&quot;</a></span><a href="http://mail.mailnews.pl/p/mydtz7o6cr/62ekfvwj1z/"><strong>Czytaj PL</strong></a><span style="background-color:transparent; color:rgb(14, 19, 23)"><a href="http://mail.mailnews.pl/p/mydtz7o6cr/62ekfvwj1z/"> to najwieksza akcja czytelnicza w kraju, a kto wie, czy takze nie na swiecie. Akcja ma charakter bezplatnej wypozyczalni bestsellerowych e-book&oacute;w i audiobook&oacute;w. Aby wziac w niej udzial, nalezy pobrac aplikacje mobilna Woblink i przy jej pomocy zeskanowac kod QR umieszczony na jednym z blisko 7000 nosnik&oacute;w na terenie calego kraju (w tym w 1000 szk&oacute;l). Kod QR jest kluczem do wirtualnej biblioteki, w kt&oacute;rej mozna znalezc polskie i swiatowe bestsellery. Czytac i sluchac bestsellerowych ksiazek bedzie mozna przez caly listopad&quot;</a>. Akcja potrwa od 2 do 30 listopada 2018 roku.</span></span></span></p>

